import { Injectable } from '@angular/core';
import {HttpClient, HttpHeaders, HttpParams, HttpResponse} from "@angular/common/http";
import {Observable} from "rxjs";
@Injectable({
  providedIn: 'root'
})
export class UserplanService {
  constructor(private http: HttpClient) {}
  public showPlan(plan:any): Observable<any>
  {
    const body = new HttpParams()
      .set(`account`, plan.account)
      .set(`sms`, plan.sms)
      .set(`call`,plan.call)
      .set(`data`,plan.data)
      .set(`validity`,plan.validity);

    const headers = new HttpHeaders({ 'Content-Type': 'application/x-www-form-urlencoded' });
    return this.http.post(`http://127.0.0.1:8000/api/choices/`,body.toString(), { headers, observe: 'response' })

    // const url='http://127.0.0.1:8000/api/choices/';
    // return this.http.post<any>(url,plan,httpOptions);
  }
}
